using ObjectiveC;using System;using SharpSwift.Attributes;using System.Collections.Generic;using Foundation;using CoreGraphics;namespace UIKit{    /// <summary>    /// The UIAccessibilityReadingContent protocol can be implemented on an object that represents content that is intended to be read by users, such as a book or an article. To give VoiceOver users a superior, continuous reading experience, you can implement this protocol on such an element, characterize it with the UIAccessibilityTraitCausesPageTurn trait, and use the UIAccessibilityScrollDirectionNext and UIAccessibilityScrollDirectionPrevious constants to enable page turning.    /// </summary>    /// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UIAccessibilityReadingContent_Protocol/index.html#//apple_ref/occ/intf/UIAccessibilityReadingContent"/>    [iOSVersion(5)]    [Export("")]    public interface UIAccessibilityReadingContent//:    {        /// <summary>        /// Returns the line number that contains the specified point. (required)        /// </summary>        /// <param name="point">A point within the bounds of the receiver’s view space, in screen coordinates. That is, a point for which [self pointInside:point withEvent:event] == YES.</param>        [iOSVersion(5)]        [Export("accessibilityLineNumberForPoint")]        int AccessibilityLineNumberForPoint(CGPoint point);                /// <summary>        /// Returns the text associated with the specified line number. (required)        /// </summary>        /// <param name="lineNumber">A line number in the receiver’s content.</param>        [iOSVersion(5)]        [Export("accessibilityContentForLineNumber")]        [return:Optional]        string AccessibilityContentForLineNumber(int lineNumber);                /// <summary>        /// Returns the onscreen frame associated with the specified line number. (required)        /// </summary>        /// <param name="lineNumber">The line number.</param>        [iOSVersion(5)]        [Export("accessibilityFrameForLineNumber")]        CGRect AccessibilityFrameForLineNumber(int lineNumber);                /// <summary>        /// Returns the text displayed on the current page. (required)        /// </summary>        [iOSVersion(5)]        [Export("accessibilityPageContent")]        [return:Unwrapped]        string AccessibilityPageContent();    }}